import React from 'react';
import './Users.css';

const users = [
  { id: 1, name: 'John Doe', email: 'john@mail.com', phone: '+91 98765 43210', status: 'Active' },
  { id: 2, name: 'Alice Smith', email: 'alice@mail.com', phone: '+91 91234 56789', status: 'Blocked' },
  { id: 3, name: 'Ravi Kumar', email: 'ravi@mail.com', phone: '+91 99876 54321', status: 'Active' },
];

export default function Users() {
  return (
    <div className="page users-page">
      <h2>Users</h2>
      <div className="user-grid">
        {users.map(u => (
          <div key={u.id} className="user-card">
            <div className="avatar">
              {u.name.charAt(0)} {/* First letter as avatar */}
            </div>
            <div className="details">
              <h3>{u.name}</h3>
              <p>{u.email}</p>
              <p>{u.phone}</p>
              <span className={`status ${u.status.toLowerCase()}`}>{u.status}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
